import React from 'react';
import './Navbar.css';
const Navbar = () => {
    return (
        <div>
        <nav>
        <div className="nav-logo-container">
            <img src='' alt="WorkLoom" />
        </div>
        <div className="navbar-links-container">
            <a href="">Features</a>
            <a href="">Workflow</a>
            <a href="">Testimonials</a>
            <a href="">Pricing</a>
            <button className="primary-button">Login</button>
        </div>
        </nav>
        <div></div>
        </div>
      );
}
export default Navbar;
